import React from "react";

interface ModalProps {
  onClose: () => void;
  pokemonDetails: {
    number: number;
    height: number;
    weight: number;
    types: string[];
    moves: string[];
    // Otros detalles que desees mostrar
  };
}

const PokemonModal: React.FC<ModalProps> = ({ onClose, pokemonDetails }) => {
  return (
    <div className="modal">
      <div className="modal-content">
        <span className="close" onClick={onClose}>
          &times;
        </span>
        <h2>Detalles de Pokémon</h2>
        <p>Número: {pokemonDetails.number}</p>
        <p>Altura: {pokemonDetails.height}</p>
        <p>Peso: {pokemonDetails.weight}</p>
        <p>Tipo(s): {pokemonDetails.types.join(", ")}</p>
        <p>Movimientos: {pokemonDetails.moves.join(", ")}</p>
        {/* Agrega otros detalles según sea necesario */}
        <button onClick={onClose}>Cerrar</button>
      </div>
    </div>
  );
};

export default PokemonModal;
